create table CSV
(
	CSVId int auto_increment
		primary key,
	FilerID varchar(200) null,
	Type varchar(200) null,
	LastName varchar(200) null,
	FirstName varchar(200) null,
	Address varchar(200) null,
	City varchar(200) null,
	State varchar(200) null,
	Zip varchar(200) null,
	PAC varchar(200) null,
	Occupation varchar(200) null,
	Employer varchar(200) null,
	Date datetime null,
	Election varchar(200) null,
	Election_Year varchar(200) null,
	Cash_Amount decimal(10,2) null,
	In_Kind_Amount decimal(10,2) null,
	In_Kind_Description varchar(200) null,
	Candidate_FirstName varchar(200) null,
	Candidate_MiddleName varchar(200) null,
	Candidate_LastName varchar(200) null,
	Candidate_Suffix varchar(200) null,
	Committee_Name varchar(200) null
);

create table Contributor
(
	ContributorId int auto_increment
		primary key,
	LastName varchar(500) null,
	FirstName varchar(500) null,
	Address1 varchar(500) null,
	Address2 varchar(500) null,
	City varchar(500) null,
	State varchar(2) null,
	Zip varchar(12) null,
	PAC varchar(1000) null,
	Occupation varchar(500) null,
	Employer varchar(1000) null
);

create table Log
(
	LogId int auto_increment
		primary key,
	Application varchar(50) not null,
	DateLogged datetime not null,
	Level varchar(10) not null,
	Message varchar(50) not null,
	UserName varchar(250) null,
	ServerName varchar(1000) null,
	Logger varchar(250) null,
	Callsite varchar(50) null,
	_Exception varchar(50) null
);

create table Office
(
	OfficeId int auto_increment
		primary key,
	Name varchar(250) null
);

create table Candidate
(
	CandidateId int auto_increment
		primary key,
	FilerId varchar(20) not null,
	OfficeId int not null,
	CandidateStatus int not null,
	ElectionType int not null,
	ElectionYear int not null,
	Firstname varchar(500) null,
	Middlename varchar(500) null,
	Lastname varchar(500) null,
	Suffix varchar(100) null,
	CommitteeName varchar(45) null,
	CandidateAddress varchar(100) null,
	Party varchar(45) null,
	constraint Candidate_ibfk_1
		foreign key (OfficeId) references Office (OfficeId)
);

create index OfficeId
	on Candidate (OfficeId);

create table Report
(
	ReportId int auto_increment
		primary key,
	ReportType varchar(45) null,
	Year int null,
	ReportFiledDate varchar(45) null,
	ReportReceivedBy varchar(45) null,
	ReportReceivedDate varchar(45) null,
	CandidateId int null,
	Url varchar(200) null,
	constraint Report_ibfk_1
		foreign key (CandidateId) references Candidate (CandidateId)
);

create index CandidateId
	on Report (CandidateId);

create table ScrapeLog
(
	ScrapeLogId int auto_increment
		primary key,
	ScrapeDate datetime null,
	ProcessDate datetime null,
	RawData longtext null,
	PageURL varchar(200) null,
	CandidateId int null,
	ReportId int null,
	constraint ScrapeLog_ibfk_1
		foreign key (CandidateId) references Candidate (CandidateId),
	constraint ScrapeLog_ibfk_2
		foreign key (ReportId) references Report (ReportId)
);

create index CandidateId
	on ScrapeLog (CandidateId);

create index ReportId
	on ScrapeLog (ReportId);

create table Contribution
(
	ContributionId int auto_increment
		primary key,
	FilerId varchar(20) null,
	CandidateId int null,
	ScrapeLogId int null,
	ContributorId int null,
	ContributionType int null,
	ContributionDate datetime null,
	Amount decimal(10,2) null,
	Description varchar(1000) null,
	constraint Contribution_ibfk_1
		foreign key (CandidateId) references Candidate (CandidateId),
	constraint Contribution_ibfk_2
		foreign key (ScrapeLogId) references ScrapeLog (ScrapeLogId),
	constraint Contribution_ibfk_3
		foreign key (ContributorId) references Contributor (ContributorId)
);

create index CandidateId
	on Contribution (CandidateId);

create index ContributorId
	on Contribution (ContributorId);

create index ScrapeLogId
	on Contribution (ScrapeLogId);

